import Link from "next/link";

const About = () => {
  return (
    <div>
      <h1>About me</h1>
      <Link href="/">Go to home</Link>

      <img src="/static/images/me.jpeg" alt="Image" height="300px" />
    </div>
  );
};

export default About;
